export const getMediaSource = (filename: string | null) => {
  if (!filename) return null;
  return MEDIA_MAP[filename] || null;
};

export const isMediaAvailable = (filename: string | null) => {
  if (!filename) return false;
  return filename in MEDIA_MAP;
};
